import React from 'react';
import ButtonLevel from './ButtonLevel';
import './Elevator.scss'



const Elevator = () => {

      const levelArr = [{
            children: 1,
            id: 1,
            className: 'level level_active'
      },
      {
            children: 2,
            id: 2,
            className: 'level'
      },
      {
            children: 3,
            id: 3,
            className: 'level'
      },
      {
            children: 4,
            id: 4,
            className: 'level'
      },
      {
            children: 5,
            id: 5,
            className: 'level'
      },
      {
            children: 6,
            id: 6,
            className: 'level'
      },
      ]
      // console.log(levelArr);



      return (
            <div className='elevator'>
                  {levelArr.map((item) =>
                        <button id={item.id} className={item.className}>{item.children}</button>
                  )}
            </div>
      );
}

export default Elevator;
